pragma solidity ^0.4.19;
//important: 0.4.19 is minimum,
// this version introduces support for declaring array sizes with constant variables.
// Update truffle dep: cd $(node -g root)/truffle/ && npm i solc@0.4.19


contract Genetic {

    //maximum cross over length; 2^C
    uint8 constant C = 5;
    uint8 constant C_MASK = uint8(1) << C - 1;

    // maximum number of random mutations per chromatid
    uint8 constant R = 5;

    // number of elements per chromatid
    uint8 internal constant L = 4;

    uint8 constant B_POW = 5;
    //number of bits per element of chromatid
    //Note; also change the uintX format of the DNA to uintB.
    uint16 constant B = uint16(1) << B_POW;

    uint16 constant ChromatidBits = uint16(L) << B_POW;

    //maximum of 4 crossovers
    uint8 constant X = 4;

    // number of chromosomes
    uint8 internal constant N = 2;

    //Genotype is structured as: bytes8[L][N][2],
    // note: 2 is the outermost length, accessed with genotype[<num>].

    //Note: optimization: instead of producing both sides of the crossover,
    // only produce the side that will be used later.
    //More optimization: do multiple crossovers at once.
    //
    //IMPORTANT: the global_locii and local_locii last slot is used to end the crossovers.
    function crossovers(uint32[L] a, uint32[L] b,
        uint16[X] locii, uint8 crossoverCount)
            public pure returns (uint32[L]) {

        require(crossoverCount >= 0);
        require(locii.length > crossoverCount);

        //the last crossover ends at the end of the chromatid
        locii[crossoverCount] = ChromatidBits - 1;

        uint32[L] memory result;

        //the first crossover starts at the start of the chromatid
        uint16 prev_global_loc = 0;
        uint16 prev_local_loc = 0;

        //for each global locus
        for (uint8 i = 0; i < crossoverCount + 1; i++) {
            // global level is a list of lists (L times a bitstring of length B)
            uint16 global_loc = locii[i] >> B_POW;
            uint16 local_loc = locii[i] - (global_loc << B_POW);

            //last crossover target is the end of the chromatid.
            if (i == crossoverCount) {
                local_loc = B;
            }

            uint32 mask;

            if (prev_global_loc == global_loc) {
                //same context as previous crossover, be more careful, but quicker
                //00001111111, 1s start at offset
                mask = (uint32(1) << (B - prev_local_loc)) - 1;
                //00001111000, 0s start at offset
                mask = mask ^ ((uint32(1) << (B - local_loc)) - 1);
                //get the masked part of a
                mask = a[global_loc] & mask;
                //apply it to the result
                result[global_loc] = result[global_loc] | mask;
            } else {
                //multi-part crossover

                //start of the crossover: copy bits start from the previous local locus (incl)
                //00001111111, 1s start at offset
                mask = (uint32(1) << (B - prev_local_loc)) - 1;
                //get the masked part of a
                mask = a[prev_global_loc] & mask;
                //apply it to the result
                result[prev_global_loc] = result[prev_global_loc] | mask;

                //in between ends: just copy completely, without masking bits.
                for (uint16 x = prev_global_loc + 1; x < global_loc; x++) {
                    result[x] = a[x];
                }

                //end of the crossover: copy bits up to the local locus (excl)
                //invert mask, we want the high-end
                //~(00001111111)  --> 11110000000
                mask = ~((uint32(1) << (B - local_loc)) - 1);
                mask = a[global_loc] & mask;

                //apply it to the result
                result[global_loc] = result[global_loc] | mask;
            }

            //crossover
            (a, b) = (b, a);

            prev_global_loc = global_loc;
            prev_local_loc = local_loc;
        }

        return result;
    }

    function pickCrossovers(uint256 randomHash) public pure returns (uint16[X], uint256, uint8) {
        // Randomly pick some crossovers
        uint16[X] memory locii;
        uint16 increase;
        uint16 j;
        uint8 crossoverCount = 0;
        for (j = 0; j < ChromatidBits; ) {

            //make a random step towards the end, always minimum 1 (must be increasing)
            increase = (uint16(randomHash) & 0x5F) + 1;
            randomHash = randomHash >> 7;
            j += increase;
            if(j >= ChromatidBits) {
                break;
            }

            //add this locus to the list of locii, this is were a crossover starts
            locii[crossoverCount] = j;

            //count how many crossovers we have
            crossoverCount += 1;

            //last array-slot should be unused
            if (crossoverCount + 1 >= X) {
                break;
            }
        }
        return (locii, randomHash, crossoverCount);
    }

    function breed(uint32[L][N][2] mother, uint32[L][N][2] father) public view returns (uint32[L][N][2]) {
        // Meiosis I: recombining alleles (Chromosomal crossovers)

        // Note about optimization I: no cell duplication,
        //  producing 2 seeds/eggs per cell is enough, instead of 4 (like humans do)

        // Note about optimization II: crossovers happen,
        //  but only 1 side of the result is computed,
        //  as the other side will not affect anything.

        uint32[L][N][2] memory result;

        // Prophase I: Crossovers
        // Methaphase I: After crossovers, split the pairs
        for (uint32 i = 0; i < N; i++) {

            //TODO improve randomness!
            //The RNG for the breeding: using the sha256 timestamp of the block
            uint256 randomHash = uint256(sha256(abi.encodePacked(block.timestamp, i)));

            //get a random 1 or 0
            uint8 swapOrder = uint8(randomHash & 1);
            randomHash = randomHash >> 1;

            // Create cross-over locii
            (uint16[X] memory locii, uint256 randomHashAfter, uint8 crossoverCount) = pickCrossovers(randomHash);
            randomHash = randomHashAfter;

            // Meiosis II: select one half of each pair (can be swapped with swapChromatid)
            // Also: the pair can chromatids may be switched around. (swapOrder)
            //get a random 1 or 0
            uint8 swapChromatid = uint8(randomHash & 1);
            randomHash = randomHash >> 1;
            result[swapOrder][i] = crossovers(mother[swapChromatid][i], mother[1 - swapChromatid][i], locii, crossoverCount);

            // Same for father
            (locii, randomHashAfter, crossoverCount) = pickCrossovers(randomHash);
            randomHash = randomHashAfter;
            //get a random 1 or 0
            swapChromatid = uint8(randomHash & 1);
            randomHash = randomHash >> 1;
            result[1 - swapOrder][i] = crossovers(father[swapChromatid][i], father[1 - swapChromatid][i], locii, crossoverCount);

            // Random mutations
            // -------------------------------------------------------------------------------------
            for (uint8 g = 0; g < L; g++) {
                //make a random number of permutations, maximum R
                for (uint8 r = 0; r < R && (randomHash & 1 == 1); r++) {
                    randomHash = randomHash >> 1;

                    //get a random 1 or 0
                    swapOrder = uint8(randomHash & 1);
                    randomHash = randomHash >> 1;

                    //(uint8(randomHash) & 0x7)  --> get a random number in [0, 127] (incl)

                    //change a random bit on a location somewhere in [0, 127] (incl)
                    result[swapOrder][i][g] = result[swapOrder][i][g] ^ (uint32(1) << (uint8(randomHash) & 0x7));
                    randomHash = randomHash >> 3;
                }
            }
        }

        return result;
    }

    // Generates (psuedo) random Pepe DNA
    function randomDNA(uint256 seed) public pure returns (uint32[L][N][2]) {

        uint32[L][N][2] memory result;

        for (uint32 i = 0; i < N; i++) {
            uint256 chromosome_seed = uint256(sha256(abi.encodePacked(seed, i)));

            // just enough bits: 256 == (L * 2 * 32), where L = 4
            for (uint8 j = 0; j < L; j++) {
                result[0][i][j] = uint32(chromosome_seed);
                chromosome_seed = chromosome_seed >> 32;

                result[1][i][j] = uint32(chromosome_seed);
                chromosome_seed = chromosome_seed >> 32;
            }
        }

        return result;
    }

}
